import React from "react";
import SearchBox from "./SearchBox";
import TubeList from "./TubeList";
import TubeDetail from "./TubeDetail";

const App = () => {
  return (
    <div className="ui container">
      <SearchBox />
      <div className="ui grid">
        <TubeList />
        <TubeDetail />
      </div>
    </div>
  );
};

export default App;
